import React from "react";
import { Form, Segment, Transition } from "semantic-ui-react";

const Place_Definer = ({ Card_Inform, visible, OnClosed, OnSumbit }) => {
  return (
    <Transition visible={visible} animation="fade up" duration={1200}>
      <div
        style={{
          position: "absolute",
          // left: "50%",
          bottom: "0%",
          width: "100%"
        }}
      >
        <div className="ui segment">
          <Form>
            <Form.Group widths="equal">
              <label>Shop name</label>
              <Form.Input fluid label="First name" placeholder="First name" />
              <Form.Input fluid label="Last name" placeholder="Last name" />
              <Form.Select
                fluid
                label="Gender"
                placeholder="Gender"
              />
            </Form.Group>
          </Form>
        </div>
      </div>
    </Transition>
  );
};

export default Place_Definer;
